snippet.description:
You’re 30 seconds away from being debt free with PDS Debt. Get your free assessment and find the best option for you at https://pdsdebt.com/free-debt-assessment/?ref=cboystv

Get entered for the Lamborghini giveaway here: https://cboystv.com/ 

Subscribe to our Podcast: https://www.youtube.com/c/LifeWideOpenwithCboysTV/featured 

Follow us on Instagram and Snapchat @cboystv

This video was done by professionals under the supervision of professionals on a closed course! 

In today’s video, we make things right with Mike and motor swap a KX 500 2 stroke dirt bike motor into his Yamaha yz250f and surprise him with it. Later our friend Jake and mechanic Gavin settle their beef after Jake stole the love of Gavins life in a boxing match.  

Follow the boys on Instagram:
